// RoomList.js - Displays room list for selected hotel with filters
import { useState, useEffect } from "react";
import { useParams } from "react-router-dom";
import axios from "axios";

export default function RoomList() {
  const { hotelId } = useParams();
  const [rooms, setRooms] = useState([]);
  const [filteredRooms, setFilteredRooms] = useState([]);

  const [minPrice, setMinPrice] = useState("");
  const [maxPrice, setMaxPrice] = useState("");
  const [selectedAmenity, setSelectedAmenity] = useState("");
  const [selectedRoomType, setSelectedRoomType] = useState("");

  const amenities = ["WiFi", "AC", "TV", "Parking", "Breakfast"];
  const roomTypes = ["Single", "Double", "Suite"];

  useEffect(() => {
    axios.get(`http://localhost:8080/rooms/hotel/${hotelId}`)
      .then(res => {
        setRooms(res.data);
        setFilteredRooms(res.data);
      })
      .catch(err => console.log(err));
  }, [hotelId]);

  const applyFilters = () => {
    let filtered = [...rooms];

    if (minPrice) filtered = filtered.filter(r => r.price >= parseFloat(minPrice));
    if (maxPrice) filtered = filtered.filter(r => r.price <= parseFloat(maxPrice));
    if (selectedAmenity) filtered = filtered.filter(r => r.amenities.includes(selectedAmenity));
    if (selectedRoomType) filtered = filtered.filter(r => r.roomType === selectedRoomType);

    setFilteredRooms(filtered);
  };

  const resetFilters = () => {
    setMinPrice("");
    setMaxPrice("");
    setSelectedAmenity("");
    setSelectedRoomType("");
    setFilteredRooms(rooms);
  };

  return (
    <div style={{ maxWidth: "1200px", margin: "20px auto", fontFamily: "-apple-system, BlinkMacSystemFont, 'Segoe UI', Roboto, 'Helvetica Neue', Arial, sans-serif" }}>
      <h2 style={{ marginBottom: "20px" }}>Rooms Available</h2>

      <div style={{ display: "flex", gap: "20px", marginBottom: "20px", flexWrap: "wrap" }}>
        <input type="number" placeholder="Min Price" value={minPrice} onChange={e => setMinPrice(e.target.value)} style={{ padding: "8px", width: "120px" }} />
        <input type="number" placeholder="Max Price" value={maxPrice} onChange={e => setMaxPrice(e.target.value)} style={{ padding: "8px", width: "120px" }} />

        <select value={selectedAmenity} onChange={e => setSelectedAmenity(e.target.value)} style={{ padding: "8px", width: "150px" }}>
          <option value="">Amenity</option>
          {amenities.map(a => <option key={a} value={a}>{a}</option>)}
        </select>

        <select value={selectedRoomType} onChange={e => setSelectedRoomType(e.target.value)} style={{ padding: "8px", width: "150px" }}>
          <option value="">Room Type</option>
          {roomTypes.map(t => <option key={t} value={t}>{t}</option>)}
        </select>

        <button onClick={applyFilters} style={{ padding: "8px 15px", backgroundColor: "#0071c2", color: "white", border: "none", cursor: "pointer" }}>Apply</button>
        <button onClick={resetFilters} style={{ padding: "8px 15px", backgroundColor: "#999", color: "white", border: "none", cursor: "pointer" }}>Reset</button>
      </div>

      {filteredRooms.map(room => (
        <div key={room.id} style={{ border: "1px solid #ddd", borderRadius: "8px", padding: "15px", marginBottom: "15px", boxShadow: "0 2px 6px rgba(0,0,0,0.1)" }}>
          <h3 style={{ marginBottom: "5px" }}>{room.roomType} - â‚¹{room.price}</h3>
          <p style={{ marginBottom: "5px" }}>Amenities: {room.amenities.join(", ")}</p>
          <p style={{ marginBottom: "5px" }}>Capacity: {room.capacity} persons</p>
        </div>
      ))}
    </div>
  );
}
